import React from 'react'
import {Link} from "react-router-dom";
import CourseEditorLayout from "./course-editor-layout";


const CourseEditor = ({history}) =>
    <div>
        <h2>
             Course Editor
            <i onClick={() => history.goBack()}
               className="fas fa-backward float-left"></i>
            <CourseEditorLayout/>
        </h2>
    </div>

